mySettings={previewParserPath:"",onShiftEnter:{keepDefault:false,openWith:"\n\n"},markupSet:[{name:"First Level Heading",key:"3",placeHolder:"Your title here...",closeWith:function(a){return miu.markdownTitle(a,"=")}},{name:"Second Level Heading",key:"4",placeHolder:"Your title here...",closeWith:function(a){return miu.markdownTitle(a,"-")}},{name:"Heading 3",key:"5",openWith:"### ",placeHolder:"Your title here..."},{name:"Heading 4",key:"6",openWith:"#### ",placeHolder:"Your title here..."},{separator:"---------------"},{name:"Bold",key:"B",openWith:"**",closeWith:"**"},{name:"Italic",key:"I",openWith:"_",closeWith:"_"},{separator:"---------------"},{name:"Bulleted List",openWith:"- "},{name:"Numeric List",openWith:function(a){return a.line+". "}}]};miu={markdownTitle:function(a,b){heading="";n=$.trim(a.selection||a.placeHolder).length;for(i=0;i<n;i++){heading+=b}return"\n"+heading}};